import { StyleSheet } from 'react-native';
const styles = StyleSheet.create({
    container: {
        width: '100%',
        height: 70,
        backgroundColor: '#20295f',

        borderTopColor: '#EE6B26',
        borderTopWidth: 5,

        position: 'absolute',
        alignItems: 'center',
        bottom: 0
    },
    button: {
        marginTop: -35,
        width: 65,
        height: 65
    },

    text: {
        marginTop: 5,
        color: '#EE6B26',
        alignItems: 'center',
        fontFamily: "Roboto"


    }
});

export default styles;
